import React, { Component } from 'react'
import {Timeline, Events, ImageEvent} from '@merc/react-timeline';
import moment from 'moment'

export class TimelineElement extends Component {

  render() {
    const convert = Object.values(this.props);
    const result = convert[0];
    const dateFormat = 'YYYY-MM-DD'

    const sorted = Object.values(this.props).sort(
 (a, b) =>
 moment(a, dateFormat).unix() - moment(b, dateFormat).unix()
)
    console.log(result);
    console.log(sorted[0]);

    return (
        <div id="timeline">
        <Timeline>
          <Events>
          {result ? result.sort((a, b) => b.date - a.date).map(d =>
            <ImageEvent
            date={d ? d.date : 'loading'}
            text={d ?d.text : 'loading'}
            src={d ?d.src : 'loading'}
            credit={d ?d.textBelow : 'loading'}
            />
          ): 'loading'        }
           </Events>
         </Timeline>
   </div>
    )
  }
}

export default TimelineElement
